import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-light bg-light">
                    <span class="navbar-brand mb-0 h1">Student Name</span>
                </nav>

            </div>
        );
    }
}

export default Header;
